Детский стул MILO выполненный в стильном скандинавском дизайне, будет соответствовать яркому и современному тону вашей кухни или спальни вашего ребенка.&lt;br /&gt;
Предназначен для детей от 6 месяцев до 12 лет. Сиденье и столик изготовлены из высококачественного полипропилена, ножки из массива бука. Стул регулируемый, возможны 3 варианта высоты сиденья и 7 вариантов высоты подставки для ног. Сиденье съемное, легко моется, также подходит для посудомоечной машины.&lt;br /&gt;
Имеются специальные ремешки для крепления, что полностью исключает вероятность падения со стула. Столик для кормления при необходимости легко снимается. Выполненный из натуральных и экологичных материалов, стул абсолютно безопасен для здоровья. Качественный и прочный, он прослужит вам и вашим деткам не один год. Кроме того, стул легко собирается и разбирается.
